import { ArrowLeftOutlined, ArrowRightOutlined } from "@mui/icons-material"
import styled from "styled-components"

const Arrow = styled.button`
border: none;
width: 50px;
height: 50px;
border-radius: 50%;
background-color: teal;
display: grid;
place-content: center;
position: absolute;
top: 0;
bottom: 0;
margin: auto;
left: ${prop=> prop.direction === "left" && "10px"};
right: ${prop=> prop.direction === "right" && "10px"};
z-index: 2;
`
const onChangeSlide = (direction)=> {}
const Slider = () => {
  return (
    <div className='slider'>
      <Arrow direction="left" onClick={()=> onChangeSlide('left')}>
        <ArrowLeftOutlined/>
      </Arrow>
      <div className="slide">
        <div className="slide-img">
          <img src="images/buy.png" alt="E Tech World" />
          {/* <img src="../../public/images/buy.png" alt="E Tech World Image ALT" /> */}
        </div>
        <div className="slide-text">
          <p>EMilius</p>
        </div>

      </div>
      <Arrow direction="right"  onClick={()=> onChangeSlide('left')}>
        <ArrowRightOutlined/>
      </Arrow>
    </div>
  )
}

export default Slider
